var moveprops = ["name", "desc", "wiki"];
console.log("tms3");

function clicked(){
	var out = "var moves = [";
	var len = 0;
	var t = ""
	for (var mon of moves){
		out += "{id: \"" + mon.id + "\", ";
		for (var prop of moveprops){
			if (mon[prop] !== undefined){
				if (isNaN(parseInt(mon[prop]))){
					out += prop + ": \"" + mon[prop] + "\", ";
				} else {
					out += prop + ": " + mon[prop] + ", ";
				}				
			}
		}
		t = "tm: \"";
		for (var tm of tms){
			if (tm.desc.indexOf(mon.name) !== -1){
				t += tm.name + ", ";
			}
		}
		if (t != "tm: \""){
			t = t.slice(0, t.length - 2) + "\"";
			out += t + ", ";
		}
		len = out.length - 2;
		out = out.slice(0, len) + "}, ";
		console.log(mon);
	}
	len = out.length - 2;
	out = out.slice(0, len) + "];";
	document.getElementById("myDiv").innerHTML = out;
}

